    false,nt"url": null,nt"notes": "Water physical and chemical data were collected
    using current meter and bottle casts from the COLUMBUS ISELIN from October 27, 1975
    to November 6, 1975. Data were submitted by Virginia Institute of Marine Science
    - Gloucester Point, as part of the Ocean Continental Shelf - Mid Atlantic (OCS -
    Mid Atlantic) project. Data were processed by NODC to the NODC standard Water Physical
    and Chemical (F014) format. Full current meter moorings descriptions are available
    at http://www.nodc.noaa.gov/General/NODC-Archive/f014.html.nnThe F014 format is
    designed to support studies of physical and chemical observations on the water column.
    Reported are measurements of temperature, salinity, conductivity, dissolved oxygen,
    nitrate, nitrite, ammonia, orthophosphate, and organic carbon. The format consists
    of four data record types, 80 characters in length, sorted by station and sequence
    numbers for proper order. The first nine columns for all records are to be used
    for file type (columns 1-3) and file identifier (columns 4-9). The file identifier,
    to be assigned by the originator, is an unique originator id for each data submission.
    After submission, the NODC reassigns to this field an unique NODC identifier for
    internal use.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
